import React from 'react';
import { Link } from 'react-router-dom'; // Asegúrate de tener esta dependencia instalada

const Header = () => {
  return (
    <header>
      <h2>Plantaciones con Juan</h2>
      <nav>
        <Link to="/">Inicio</Link>
        <Link to="/productos">Productos</Link>
        <Link to="/carrito">Carrito</Link>
      </nav>
      <div>
        <span>0</span> {/* Conteo de artículos en el carrito */}
      </div>
    </header>
  );
};

export default Header; // Solo una exportación por defecto
